import logging as logfrom phase02.csv_handler import read_data_from_csvfrom phase02.file_handler import retrieve_filefrom phase02.calculator import DataCalculator as DataCalcdef main(print_data: bool = False):    """    Main function to run the program, opens a file dialog to select the data file to process    """    # Open a os file dialog to select the data file    try:        file_path = retrieve_file()    except Exception as e:        if print_data:            print(f"\n\tError: {e}\n")        else:            log.error(f"\n\tError: {e}\n")        return    # Read the data    data = read_data_from_csv(file_path)    if print_data:        print(data.head(5))    else:        log.info("\n\tData read successfully\n")        log.debug(f"\n{data.head(5)}\n")    for col in data.columns:        analysis = DataCalc(data[col].tolist())        if print_data:            print(f"\n\tAnalysis for {col}")            print(f"\n\tmean: {analysis.mean}")            print(f"\n\tmedian: {analysis.median}")            print(f"\n\tmode: {analysis.mode}")            print(f"\n\tvariance: {analysis.variance}")            print(f"\n\tstandard deviation: {analysis.standard_deviation}")            print(f"\n\tmin: {analysis.min}")            print(f"\n\tmax: {analysis.max}\n")        else:            log.info(f"\n\tAnalysis for {col}")            log.info(f"\n\tmean: {analysis.mean}")            log.info(f"\n\tmedian: {analysis.median}")            log.info(f"\n\tmode: {analysis.mode}")            log.info(f"\n\tvariance: {analysis.variance}")            log.info(f"\n\tstandard deviation: {analysis.standard_deviation}")            log.info(f"\n\tmin: {analysis.min}")            log.info(f"\n\tmax: {analysis.max}\n")if __name__ == "__main__":    # Set the log level to debug    log.basicConfig(level=log.DEBUG)    main()